import './Home.css';
import React, { useState } from 'react';
import gamersLogo from './images/GamersLogo.png';

function Home() {
    function registerHandler() {
        console.log("clicked")
        
    }
  return (
    
    <div className="Home">
      <header className="Home-header">
        <img src="gamersLogo" alt="GamersOnly Logo"/>  


  
    
    <div className="form-container">
      <form className="register-form">
        {/* Uncomment the next line to show the success message */}
        {/* <div class="success-message">Success! Thank you for registering</div> */}
        <input
          onChange={handleUserNameChange}
          value={values.userName}
          id="user-name"
          className="form-field"
          type="text"
          placeholder="Username"
          name="userName"
        />
        {/* Uncomment the next line to show the error message */}
        {/* <span id="first-name-error">Please enter a first name</span> */}
        <input
          onChange={handlePasswordChange}
          value={values.password}
          id="user-password"
          className="form-field"
          type="password"
          placeholder="Password"
          name="password"
        />
        {/* Uncomment the next line to show the error message */}
        {/* <span id="email-error">Please enter an email address</span> */}
        <button className="form-field" type="submit" onClick= {registerHandler}>Sign In</button>
        <button className="form-field" onClick= {registerHandler}>Register</button>
      </form>
    </div>

        <p>
          Find some Gamers
        </p>
      </header>
    </div>
  );
}

export default Home;
